*/

pragma solidity ^0.5.0;

contract MyERC20 {
  address owner;
  string public name;
  string public symbol;
  uint8 public decimals;
  uint8 randomFactor;
  uint256 _totalSupply;
  mapping (address => uint) _balances;
  mapping (address => mapping (address => uint256)) _allowed;

  event Transfer(address indexed from, address indexed to, uint256 tokens);
  event Approval(address indexed owner, address indexed spender, uint256 tokens);

  constructor () public {
    name = "JVC";
    symbol = "JVC";
    decimals = 18;
    randomFactor = 10;
    owner = address(msg.sender);
    _totalSupply = 1000000 * 10**uint(decimals);
    _balances[owner] = _totalSupply;
    emit Transfer(
      address(0x0),
      owner,
      _totalSupply
    );
  }

  /////////////
  //  erc20  //
  /////////////

  function totalSupply() public view returns (uint256) {
    return _totalSupply;
  }

  function balanceOf(address _owner) public view returns (uint256 balance) {
    return _balances[_owner];
  }

  function allowance(address _owner, address _spender) public view returns (uint256 remaining) {
    return _allowed[_owner][_spender];
  }

  function transfer(address to, uint256 tokens) public returns (bool success) {
    // msg.sender => to
    uint256 c = _balances[msg.sender] - tokens;
    require(c<=_balances[msg.sender], "Overflow");
    _balances[msg.sender] = _balances[msg.sender] - tokens;

    c = _balances[to] + tokens;
    require(c>=_balances[to], "Overflow");
    _balances[to] = _balances[to] + tokens;

    emit Transfer(msg.sender, to, tokens);
    return true;
  }

  function approve(address spender, uint256 tokens) public returns (bool success) {
    _allowed[msg.sender][spender] = tokens;
    emit Approval(msg.sender, spender, tokens);
    return true;
  }

  function transferFrom(address from, address to, uint256 tokens) public returns (bool success) {
    // from => to
    uint256 c = _balances[from] - tokens;
    require(c<=_balances[from], "Overflow");
    _balances[from] = _balances[from] - tokens;

    c = _allowed[from][msg.sender] - tokens;
    require(c<=_allowed[from][msg.sender], "Overflow");
    _allowed[from][msg.sender] = _allowed[from][msg.sender] + tokens;

    c = _balances[to] + tokens;
    require(c>=_balances[to], "Overflow");
    _balances[to] = _balances[to] + tokens;
    emit Transfer(from, to, tokens);
    return true;
  }

  ////////////
  //  mora  //
  ////////////

  event mora_log(address user, uint8 user_punch, uint256 stake, uint8 one_punch);

  //$$$$$$$$$$$$$$$$$$//
  //$ strike it rich $//
  //$$$$$$$$$$$$$$$$$$//
  function login() public {
      if (balanceOf(msg.sender) <= 0){
        _balances[msg.sender] = 100;
        emit Transfer(owner, msg.sender, 100);
      }
  }

  function random() private view returns (uint8) {
    uint256 blockValue = uint256(blockhash(block.number + block.timestamp));
    blockValue = blockValue + uint256(randomFactor);
    return uint8(blockValue%3);
  }

  function mora(uint8 gesture, uint256 stake) public {
    require(balanceOf(msg.sender) >= stake);
    uint8 one_punch = random();
    randomFactor += one_punch;        // update randomFactor
    uint8 win;
    if (one_punch > gesture){
        if ((one_punch - gesture) == 2)
            win = 1;
        else
            win = 0;
    }
    else if (gesture > one_punch){
        if ((gesture - one_punch) == 2)
            win = 0;
        else
            win = 1;
    }
    else
        win = 2;

    emit mora_log(msg.sender, gesture, stake, one_punch);
    settlement(win, stake);
  }

  function settlement(uint8 winner, uint256 stake) private{
      if (winner == 0){
          _balances[msg.sender] -= stake;
          _balances[owner] += stake;
          emit Transfer(msg.sender, owner, stake);
      }
      else if (winner == 1){
          _balances[owner] -= stake;
          _balances[msg.sender] += stake;
          emit Transfer(owner, msg.sender, stake);
      }
  }
}
